/*
    function returns
    pTwd[0] - pointer to the twiddle factors
    pInc[0] - pointer to the increments
    pDigrevtbl[0] - pointer to the digit reversal table
    Input:
    N - FFT size
*/
void fft_getTables_24x24(cuint64_ptr *pTwd,
                  cint16_ptr *pInc,
                  cint16_ptr *pDigrevtbl,
                  int N)
{
    switch (N) {
        case 16:    pInc[0]=inc16;   pTwd[0]=twd16;  break;
        case 32:    pInc[0]=inc32;   pTwd[0]=twd32;  break;
        case 64:    pInc[0]=inc64;   pTwd[0]=twd64;  break;
        case 128:   pInc[0]=inc128;  pTwd[0]=twd128; break;
        case 256:   pInc[0]=inc256;  pTwd[0]=twd256; break;
        case 512:   pInc[0]=inc512;  pTwd[0]=twd512; break;
        case 1024:  pInc[0]=inc1024; pTwd[0]=twd1024; break;
        case 2048:  pInc[0]=inc2048; pTwd[0]=twd2048; break;
        case 4096:  pInc[0]=inc4096; pTwd[0]=twd4096; break;
    }
    {
        int norm;
        ae_q56s tmp = AE_CVTQ48A32S(N);
        norm = AE_NSAQ56S(tmp);
        pDigrevtbl[0] = digrevtbl+((1<<(8+26-norm))-1)-1;
    }
}
